import logo from './logo.svg';

import './App.css';

function App() {
  return (
    <div className="button-container">
      <Link to="/inventory">
        <button className="btn">Inventory Manager</button>
      </Link>
      <Link to="/invoice">
        <button className="btn">Invoice Generator</button>
      </Link>
      <Link to="/expense">
        <button className="btn">Expense Tracker</button>
      </Link>
      <Link to="/payment">
        <button className="btn">Payment Gateway</button>
      </Link>
    </div>
  );
}

export default App;
